import getRoleFromLink from "./search";
import {useState} from 'react';

interface JobListHandlerProps {
    currentJob: any,

}

function JobListHandler (props:JobListHandlerProps):JSX.Element {

    const [role, setRoleState]=useState<any>

        function getRole():void {

            getRoleFromLink(JSON.stringify(props.currentJob.role.self))


                     setRole={setRole} 
}

    function setRole(role:string) {
        setRoleState(role);
    }

    return (

        <div >
            <h4> CurrentJobb </h4>

            {JSON.stringify(props.currentJob.id)}
        {getRole()}


    <h4> CurrentJobbOver </h4>

            </div>


    );    
}
export default JobListHandler ;
